import React from 'react';
import './income.css'

export function Income (){
    return (
        <div>
            <div className='container'>
                <h1 className='title'>
                    Sometimes I want to destrot this world
                </h1>
                <h3 className='subtitle'>
                    Everything is shit! But not today.
                </h3>

                <div className='box'>
                    <p className='description'>
                        Lorem ipsum dolor sit amet, 
                        consectetur adipisicing elit. 
                        Nesciunt suscipit corrupti sint, 
                        consectetur sapiente natus fuga labore. 
                        Exercitationem obcaecati consequuntur quod 
                        ratione odio aliquid, itaque, vel ipsum, 
                        molestias quia odit?
                    </p>
                </div>
            </div>
        </div>
    )
}















